<Form.List name="Experience">
        {(fields, { add, remove }) => (
          <>
            {fields.length > 0 && (
              <>
                <h5><b>Experience</b></h5>
                <hr />
                <div className="row">
                  {fields.map(({ key, name, ...restField }) => (
                    <React.Fragment key={key}>
                      <div className="col-md-3">
                        <Form.Item
                          {...restField}
                          name={[name, "Company"]}
                          rules={[
                            { required: false, message: "Missing Company" },
                          ]}
                        >
                          <Input placeholder="Company" />
                        </Form.Item>
                      </div>

                      <div className="col-md-2">
                        <Form.Item
                          {...restField}
                          name={[name, "Years"]}
                          rules={[
                            { required: false, message: "Missing Year" },
                          ]}
                        >
                          <Input placeholder="Years" />
                        </Form.Item>
                      </div>

                      <div className="col-md-3">
                        <Form.Item
                          {...restField}
                          name={[name, "Place"]}
                          rules={[
                            { required: false, message: "Missing Place" },
                          ]}
                        >
                          <Input placeholder="Place" />
                        </Form.Item>
                      </div>

                      <div className="col-md-2">
                        <Form.Item
                          {...restField}
                          name={[name, "year"]}
                          rules={[
                            { required: false, message: "Missing Year Range" },
                          ]}
                        >
                          <Input placeholder="Year Range" />
                        </Form.Item>
                      </div>
                      <div className="col-md-2">
                        <MinusCircleOutlined
                          style={{ fontSize: 20, color: "red" }}
                          onClick={() => remove(name)}
                        />
                      </div>
                    </React.Fragment>
                  ))}
                </div>
                <Form.Item>
                  <Button
                    type="dashed"
                    onClick={() => add()}
                    block
                    icon={<PlusOutlined />}
                  >
                    Add Experience
                  </Button>
                </Form.Item>
              </>
            )}
          </>
        )}
      </Form.List>






      <h5><b>Project</b></h5>
      <hr/>
      <Form.List name="projects">
        {(fields, { add, remove }) => (
          <>
            <div className="row">
              {fields.map(({ key, name, ...restField }) => (
                <>
                  <div className="col-md-4">
                    <Form.Item
                      {...restField}
                      name={[name, "Title"]}
                      rules={[
                        { required: true, message: "Missing Title" },
                      ]}
                    >
                      <Input placeholder="Project Title" />
                    </Form.Item>
                  </div>

                  <div className="col-md-4">
                    <Form.Item
                      {...restField}
                      name={[name, "description"]}
                      rules={[{ required: true, message: "Missing description" }]}
                    >
                      <TextArea placeholder="Description" />
                    </Form.Item>
                  </div>

                  <div className="col-md-2">
                    <Form.Item
                      {...restField}
                      name={[name, "year"]}
                      rules={[
                        { required: true, message: "Missing Year Range" },
                      ]}
                    >
                      <Input placeholder="Year Range" />
                    </Form.Item>
                  </div>
                  <div className="col-md-2">
                    <MinusCircleOutlined
                      style={{ fontSize: 20, color: "red" }}
                      onClick={() => remove(name)}
                    />
                  </div>
                </>
              ))}
            </div>

            <Form.Item>
              <Button
                type="dashed"
                onClick={() => add()}
                block
                icon={<PlusOutlined />}
              >
                Add Project
              </Button>
            </Form.Item>
          </>
        )}
      </Form.List>
    </div>
  );
}

export default ExperienceProjects;
